let urlcovid = "http://172.27.1.40:8080/geoserver/smsa/ows?service=WFS&version=1.0.0&request=GetFeature&typeName=smsa%3Acovid&maxFeatures=5000&outputFormat=application%2Fjson"

function pointToLayer(feature, layer) {

    let notIcon = L.icon({
        iconUrl: '/static/leaflet/icons/ponto_vermelho.png',
        background: '#cd0a1c',
        iconSize: [9, 9]
    });

    return L.marker(layer, {icon: notIcon});
}

let covid = new L.GeoJSON.AJAX(urlcovid, {
    pointToLayer: pointToLayer,
    onEachFeature: function (feature, layer) {
        if (feature.properties && feature.properties.notificacao) {
            layer.bindPopup("Notificação:" + feature.properties.notificacao);
            layer.bindTooltip("Notificação:" + feature.properties.notificacao);
        }
    },
});




